import React from "react";


const DogRunPage: React.FC = () => {
  return (
    <div>
      <h2>Welcome to the Dog Run Page!</h2>
    </div>
  );
};
<Routes>
<Route path="/dogrun" element={<DogRunPage />} />  {/* ドッグランページのルート */}
</Routes>

export default DogRunPage;
